import React, { Component } from 'react'
import PropTypes from 'prop-types';
import TutorialData from './TutorialData';

class Tutorial extends Component {
    state = {
        articles: []
    }

    componentDidMount() {
        client.getEntries({content_type : 'author'})
            .then((response) => {
                this.setState({
                    articles: response.items
                })
            })
            .catch(console.error)
    }
    render() {
        const {article} = this.props
        return (
            <>
                <TutorialData author={this.state.articles} />
                <div className='px-5 md:px-20 lg:px-32'>
                    <p className='poppins-600 text-25 bg-gradient-purple-to-pink text-white px-16 py-16 rounded-2xl text-left'>Tutorial</p>
                    <p>{article.fields.title}</p>
                </div>
            </>
        )
    }
}

Tutorial.propTypes = {
    article: PropTypes.object
}

export default Tutorial
